import React from 'react'
import Logo from '../logo/picklehut-low-resolution-logo-color-on-transparent-background.png'
import './logo.css'

function logo() {
    return (
        <div>
            <img className='logo' src={Logo} alt='logo'></img>
        </div>
    )
}

export default logo
